      # mean that the final package will fail to build, and we will still get a
      # usefully warmed cache.
      RUN go list -f '{{.ImportPath}}{{if or .Error .DepsErrors}} ERROR{{end}}' ./vendor/... | grep -v ERROR | xargs go build -v || true
